import React, { Component } from "react";

class ProductsPage extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="bg">
        <p>UNDER CONSTRUCTION</p>
      </div>
    );
  }
}

export default ProductsPage;
